import React, { Component } from "react";
import Carousel from "react-bootstrap/Carousel";
import Slide1 from "../../assests/img/carousal/slide1.webp";
import Slide2 from "../../assests/img/carousal/slide2.webp";
import Slide3 from "../../assests/img/carousal/slide3.webp";
import ScrollDown from "../scroll-down/scroll-down.component";
import "./my-carousal.styles.css";

class MyCarousal extends Component {
    render() {
        return (
            <div id="home">
                <Carousel controls={true} indicators interval={2500} pauseOnHover={false}>
                    <Carousel.Item>
                        <img className="d-block w-100 custom-img" src={Slide2} alt="First slide" />
                    </Carousel.Item>
                    <Carousel.Item>
                        <img className="d-block w-100 custom-img" src={Slide3} alt="Third slide" />
                    </Carousel.Item>
                    <Carousel.Item>
                        <img className="d-block w-100 custom-img" src={Slide1} alt="Third slide" />
                    </Carousel.Item>
                </Carousel>
                <ScrollDown />
            </div>
        );
    }
}

export default MyCarousal;
